import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom
import Logo from '../images/Logo.png';
import '../styles/style.css';

const Navbar = () => {
  return (
    <nav className='Navbar'>
      <div>
        <img src={Logo} alt="Little Lemon Logo" />
      </div>
      <ul>
        <li>
          <Link to="/">Home</Link> {/* Use Link for navigation */}
        </li>
        <li>
          <Link to="/about">About</Link> {/* Use Link for navigation */}
        </li>
        <li>
          <Link to="/services">Reservations</Link> {/* Use Link for navigation */}
        </li>
        <li>
          <Link to="/contact">Order</Link> {/* Use Link for navigation */}
        </li>
        <li>
          <Link to="/login">Login</Link> {/* Use Link for navigation */}
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
